                    <p class="mar_t_1">
                        In Babati town, most of the urban commercial activities are
                        concentrated and carried out in a place known as Babati Mjini which
                        forms the Central Business District of the town. However, a number of
                        shops are located in the surrounding urban centre and corner-shops
                        also found distributed in different areas in the town mostly selling
                        the daily needed commodities of the respective residents.</p>

                    <p class="mar_t_1">Commercial
                        activities range from retail to sub-whole sale shops and other small
                        scale entrepreneurs. Most of the foodstuffs come from areas within
                        Babati District in Manyara Region. Some consignments of food stuff
                        are brought from as far as Makanya in Same District, Kilimanjaro
                        Region. Other commodities and goods other than food stuff mostly
                        imported from areas outside the town. Second hand clothes, for
                        instance are brought from Dar es Salaam, Arusha and Kenya. Shoes are
                        imported from Arusha, Dar es Salaam and Kenya.</p>
                    <p class="mar_t_1">Alike
                        in other urban centers in Tanzania there are two categories of
                        commercial and trading activities in Babati Town. The formal
                        commercial activities and the informal commercial activities. While
                        formal business is carried out in designated places, informal trading
                        is conducted haphazardly in undesignated areas/sites such as along
                        road reserves all around the Central Bus Stand, at the Central and
                        Silent Inn Markets and also at open spaces situated in different
                        parts of the town.</p>
                    <p class="mar_t_1">
                        The sector provides employment opportunities to a large number and a
                        cross-section of the people dealing with petty trading business in
                        Babati town.</p>

