                    <p class="western" align="justify" style="margin-top: 0.17in; margin-bottom: 0in; line-height: 100%">
                        Babati Town is linked with the outside areas both within and outside
                        district and region by road transport system.  The Great North Road
                        (Arusha- Dodoma-Mbeya Road) and Arusha – Singida – Mwanza Road
                        forms the backbone of the transport system for the town.  The twin
                        roads open the town with the outside world.  This implies that the
                        town depends entirely on road transport for both internal and
                        external trips.  This is due to the fact that other modes of
                        transport are not available in the town.
                    </p>
                    <p class="western" align="justify" style="margin-top: 0.17in; margin-bottom: 0in; line-height: 100%">
                        Most of internal movements (within the town ) are basically through
                        walking and cycling and for those few who can afford transport costs
                        usually hire taxis or use private  cars which are also limited in
                        number.  As for external  trips the dependable means include public
                        transport provided by buses which play in different destinations for
                        instance, to and from Arusha, Moshi, Dodoma, Singida, Dar es salaam
                        to mention a few.  Some of the trips are made using trucks especially
                        for hauling crops and other goods, in some cases bicycles depend on
                        the purpose and destination of the trip.  Nevertheless the majority
                        of residents are pedestrians who make their respective trips by
                        walking.</p>
                    <ol start="3">
                        <ol start="2">
                            <ol>
                                <li><p class="western" align="justify" style="margin-top: 0.17in; margin-bottom: 0in; line-height: 100%">
                                        <font color=""><b>Road Transport system</b></font></p>
                            </ol>
                        </ol>
                    </ol>
                    <p class="western" align="justify" style="margin-top: 0.17in; margin-bottom: 0in; line-height: 100%">
                        <font color="">A already indicated the road transport system
                            in Babati town which is mainly formed by two major roads that cross
                            the town centre from Arusha leading to Singida and Dodoma
                            Municipalities and thus, the arterial roads link the town with the
                            rest of the country.  In additional to that the road network consists
                            of other roads – forming a concentric pattern of access roads
                            (streets) rural roads and cattle tracks type of roads/path which
                            include pedestrians paths.</font></p>
                    <p class="western" align="justify" style="margin-top: 0.17in; margin-bottom: 0in; line-height: 100%">
                        <font color="">The road network in Babati town covers an
                            approximate area of about 356 kilometres.  Tarmac surface roads cover
                            only 4.6 kilometres and these are combined stretches of the arterial
                            roads (Arusha – Dodoma and Singida roads and Mrara Road). The
                            remaining proportion of gravel and earth covering about 56.6
                            kilometres and 295 kilometres respectively.  Provision of storm water
                            drainage is inadequate as it is estimated that about 65% of the
                            existing roads are lacking storm water drains.  Limited existing
                            storm water drains are confined along the roads serving the central
                            area of the town.</font></p>
